CREATE TABLE stories (
    id integer NOT NULL,
    title text,
    programunit_id integer,
    created_at text,
    updated_at text
);
CREATE TABLE words (
    id integer NOT NULL,
    word character varying(255),
    startingletter character varying(255),
    cvc boolean,
    ccvc boolean,
    diagraph boolean,
    splitdiagraph boolean,
    numsyllables integer,
    numletters integer,
    numphonemes integer,
    image character varying(255),
    nonsense boolean,
    entrypointmodule integer,
    entrypointunit integer,
    entrypoint_session integer,
    created_at timestamp without time zone NOT NULL,
    updated_at timestamp without time zone NOT NULL,
    tricky boolean,
    cvcc boolean,
    imagepossible boolean,
    imagerequired boolean,
    completed boolean,
    nondecodable boolean
);
CREATE TABLE phonemes (
    id integer NOT NULL,
    phoneme character varying(255),
    created_at timestamp without time zone NOT NULL,
    updated_at timestamp without time zone NOT NULL,
    imagepossible boolean,
    mneumonic character varying(255),
    completed boolean,
    mneumonic_two character varying(255),
    grapheme character varying(255)
);
CREATE TABLE sentences (
    id integer NOT NULL,
    text string,
    linking_index string,
    section_id integer,
    created_at string,
    updated_at string,
    is_target_sentence boolean,
    is_dummy_sentence boolean
);
CREATE TABLE data_phonemes (
    id integer NOT NULL,
    section_id integer,
    phoneme_id integer,
    is_target_phoneme text,
    is_dummy_phoneme text,
    linking_index integer,
    created_at timestamp text,
    updated_at timestamp text
);
COMMIT;
